import React from "react";

function App() {
  function Card(props) {
    <div>
      <div className="top">
        <h2>{props.name}</h2>
        <img src={props.img} />
      </div>
      <div className="bottom">
        <p>{props.tel}</p>
        <p>{props.email}</p>
      </div>
    </div>;
  }
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      <div className="card">
        <Card name="Beyonce" />
      </div>
    </div>
  );
}

export default App;
